INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES ("物理防御力（ダウン不可）アップ", 76030005, "boss_def_lower_limit", "バトル開始時、すべてのモンスターの物理防御力を中アップさせる。この効果は物理防御力ダウンの影響を受けない。", 603000504);
INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES ("魔法防御力（ダウン不可）アップ", 76030005, "boss_magic_def_lower_limit", "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", 603000505);
INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES ("ＴＰダウンカット", 76030005, "boss_tp_down_cut", "バトル開始時、すべてのモンスターがＴＰダウン\n100％カット状態になる。", 603000506);
